CREATE OR REPLACE PROCEDURE P_MID_TRANS_TYPE_IND
AS
/*
	交易类型注记表 MID_TRANS_TYPE_IND
	author:XM
	date:2015-08-10
*/

/* 0. 创建临时表 */
/*
CREATE TABLE MMAPDM.TMP_TXN_CODE(
		AUXTX_ID VARCHAR(15)
		, AUXTX_DESC VARCHAR2(120)
		, INCREASE_FLG NUMERIC(1,0)
    , DECREASE_FLG NUMERIC(1,0)
    , DEPOSIT_FLG NUMERIC(1,0)
    , WITHDRAW_FLG NUMERIC(1,0)
    , INVESTMENT_FLG NUMERIC(1,0)
    , EXCHANGE_FLG NUMERIC(1,0)
    , DEBT_FLG NUMERIC(1,0)
    , INTERNET_SHOPPING_FLG NUMERIC(1,0)
    , AUTOPAYBILL_FLG NUMERIC(1,0)
    , PAYBILL_FLG NUMERIC(1,0)
    , LENDING_FLG NUMERIC(1,0)
    , CHARITY_FLG NUMERIC(1,0)
);
COMMIT;
*/
/* 1. 向交易类型注记表中插入数据 */
/*
-----------------------插入余额增加的类型注记-----------------------
  ,TRANSCDE_ID
  ,TRANSCDE_NAME
  ,TRANSTYP_ID
  ,TRANSTYP_NAME
  ,REMARK
) 
SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'INCREASE'
  ,'余额增加交易'
  ,NULL
FROM TXN_CODE
WHERE INCREASE_FLG = '1'
UNION ALL
-----------------------插入余额减少的类型注记-----------------------
SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'DECREASE'
  ,'余额减少交易'
  ,NULL
FROM TXN_CODE
WHERE DECREASE_FLG = '1'

UNION ALL
-----------------------插入存款行为的类型注记-----------------------
SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'DEPOSIT'
  ,'存款交易'
  ,NULL
FROM TXN_CODE
WHERE DEPOSIT_FLG = '1'

UNION ALL
-----------------------插入取款行为的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'WITHDRAW'
  ,'取款交易'
  ,NULL
FROM TXN_CODE
WHERE WITHDRAW_FLG = '1'
UNION ALL

-----------------------插入投资交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'INVESTMENT'
  ,'投资交易'
  ,NULL
FROM TXN_CODE
WHERE INVESTMENT_FLG = '1'
UNION ALL

-----------------------插入换汇交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'EXCHANGE'
  ,'换汇交易'
  ,NULL
FROM TXN_CODE
WHERE EXCHANGE_FLG = '1'
UNION ALL

-----------------------插入负债交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'DEBT'
  ,'负债交易'
  ,NULL
FROM TXN_CODE
WHERE DEBT_FLG = '1'
UNION ALL

-----------------------插入网上消费交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'INTERNET_SHOPPING'
  ,'网上消费交易'
  ,NULL
FROM TXN_CODE
WHERE INTERNET_SHOPPING_FLG = '1'
UNION ALL

-----------------------插入自动代缴交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'AUTOPAYBILL'
  ,'自动代缴交易'
  ,NULL
FROM TXN_CODE
WHERE AUTOPAYBILL_FLG = '1'
UNION ALL

-----------------------插入自行缴费交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'PAYBILL'
  ,'自行缴费交易'
  ,NULL
FROM TXN_CODE
WHERE PAYBILL_FLG = '1'
UNION ALL

-----------------------插入贷款交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'LENDING'
  ,'贷款交易'
  ,NULL
FROM TXN_CODE
WHERE LENDING_FLG = '1'
UNION ALL

-----------------------插入慈善捐款交易的类型注记-----------------------

SELECT 
   TO_NUMBER (TO_CHAR(SYSDATE,'yyyymmdd'))
  ,AUXTX_ID
  ,NULL
  ,'CHARITY'
  ,'慈善捐款交易'
  ,NULL
FROM TXN_CODE
WHERE CHARITY_FLG = '1'
;
*/
END P_MID_TRANS_TYPE_IND;